@Test
    public void toJsonReturnsExpected() {
        final JsonObject actual =
                ModifyConnectionResponse.of(TestConstants.CONNECTION.getId(), DittoHeaders.empty()).toJson();

        assertThat(actual).isEqualTo(KNOWN_JSON);
    }

